import React from 'react';

const Card = ({ name, price, id }) => {
  const fish_id = id+1
  return (
    <div className='tc grow bg-light-green fl w-10 pa2 '>
      <img alt='fish' src={`https://acnhapi.com/v1/images/fish/${fish_id}?size=200x200`} />
      <div>
        <h4>{name}</h4>
        <p>价格:{price}</p>
      </div>
    </div>
  );
}

export default Card;
